import {useNavigate} from 'react-router-dom'

export const Intro =()=>{

    const {navigate} = useNavigate()
setTimeout(() => {
    navigate('Login'); //this.props.navigation.navigate('Login')
}, 5000);  //5000 milliseconds
    return(

    <div> <img src={require('../../../../img/marvel-logo.gif')} alt="loading..."/></div>
    )
}
